import Clock from "react-live-clock";

const Today = () => {
  const today = new Date();

  return (
    // <div>
    //   {today.getFullYear()}년 {today.getMonth() + 1}월 {today.getDate()}일
    // </div>
    <div>
      <Clock format={"YYYY년 MM월 DD일 HH:mm:ss"} timezone={"Asia/Seoul"} />
    </div>
  );
};

export default Today;
